from sympy.ntheory.digits import digits
def a(n, startk=1):
    k = max(startk, len(bin(3**(n-1))[2:]))
    pow2 = 2**k
    while 2 in digits(pow2, 3)[-n:]:
        k += 1
        pow2 *= 2
    return k
